import styled from 'styled-components'
import { FlatList } from 'react-native'


export const Title = styled.label`
    background-color: #C4170C;
    width: 100%;
    font-weight: bold;
    text-align: center;
    margin-top: 10px;
    padding: 10px 0px;
    font-size: 20px;
    color: #fff;
    line-height: 21px;
    font-family: opensans,helvetica,arial,sans-serif;
`;

export const ContainerNoticia = styled.div`
    /* flex: 1; */
    margin-top: 15px;
    margin: 10px;
    font-size: 18px;
    font-family: opensans,helvetica,arial,sans-serif;
    font-weight: bold;
    font-weight: justify.
    
    /* display: flex; */

`
export const NoticiaPrincipal = styled.div`
    display: inline-block;
    position: relative;

    label {
        position: absolute;
        top: 145px;
        right: 20px;
        color: #fff;
    }

    img {
        width: 100%;
        height: 200px;
    }

`
export const NoticiaSecundaria = styled.div`

    label: {
        font-size: 32px;
    }

    img {
        width: 100%;
        height: 200px;
    }

`
export const NoticiaTerciaria = styled.div`
   

    label: {
        font-size: 32px;
    }

    img {
        width: 100%;
        height: 200px;
    }

`
